(window.webpackJsonp=window.webpackJsonp||[]).push([[27],{"ie/I":function(e){e.exports=[{id:1,type:"  consul_acl_auth_method",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the ACL auth method.\n",elementType:"li",listDepth:1},{name:"type",description:"<strong>(Required)</strong> The type of the ACL auth method.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A free form human readable description of the auth method.\n",elementType:"li",listDepth:1},{name:"config",description:"<strong>(Required)</strong> The raw configuration for this ACL auth method.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_auth_method.html",docType:""},{id:2,type:"  consul_acl_binding_rule",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"auth_method",description:"<strong>(Required)</strong> The name of the ACL auth method this rule apply.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A free form human readable description of the\nbinding rule.\n",elementType:"li",listDepth:1},{name:"selector",description:"<strong>(Optional)</strong> The expression used to math this rule against valid\nidentities returned from an auth method validation.\n",elementType:"li",listDepth:1},{name:"bind_type",description:"<strong>(Required)</strong> Specifies the way the binding rule affects a token\ncreated at login.\n",elementType:"li",listDepth:1},{name:"bind_name",description:"<strong>(Required)</strong> The name to bind to a token at login-time.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_binding_rule.html",docType:""},{id:3,type:"  consul_acl_policy",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the policy.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> The description of the policy.\n",elementType:"li",listDepth:1},{name:"rules",description:"<strong>(Required)</strong> The rules of the policy.\n",elementType:"li",listDepth:1},{name:"datacenters",description:"<strong>(Optional)</strong> The datacenters of the policy.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_policy.html",docType:""},{id:4,type:"  consul_acl_role",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:"<strong>(Required)</strong> The name of the ACL role.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> A free form human readable description of the role.\n",elementType:"li",listDepth:1},{name:"policies",description:"<strong>(Optional)</strong> The list of policies that should be applied to the role.\n",elementType:"li",listDepth:1},{name:"service_identities",description:"<strong>(Optional)</strong> The list of service identities that should\nbe applied to the role.\n",elementType:"li",listDepth:1},{name:"",description:"<p>The <code>service_identities</code> supports:</p>",elementType:"p"},{name:"service_name",description:"<strong>(Required)</strong> The name of the service.\n",elementType:"li",listDepth:1},{name:"datacenters",description:"<strong>(Optional)</strong> The datacenters the effective policy is valid within.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_role.html",docType:""},{id:5,type:"  consul_acl_token",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"accessor_id",description:"<strong>(Optional)</strong> The uuid of the token. If omitted, Consul will\ngenerate a random uuid.\n",elementType:"li",listDepth:1},{name:"description",description:"<strong>(Optional)</strong> The description of the token.\n",elementType:"li",listDepth:1},{name:"policies",description:"<strong>(Optional)</strong> The list of policies attached to the token.\n",elementType:"li",listDepth:1},{name:"local",description:"<strong>(Optional)</strong> The flag to set the token local to the current datacenter.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_token.html",docType:""},{id:6,type:"  consul_acl_token_policy_attachment",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"token_id",description:"<strong>(Required)</strong> The id of the token.\n",elementType:"li",listDepth:1},{name:"policy",description:"<strong>(Required)</strong> The name of the policy attached to the token.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/acl_token_policy_attachment.html",docType:""},{id:7,type:"  consul_agent_service",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Optional)</strong> The address of the service. Defaults to the\naddress of the agent.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the service.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - <strong>(Optional)</strong> The port of the service.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> A list of values that are opaque to Consul,\nbut can be used to distinguish between services or nodes.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/agent_service.html",docType:""},{id:8,type:"  consul_autopilot_config",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the agent\'s\ndefault datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"cleanup_dead_servers",description:'<li><p><a name="cleanup_dead_servers"></a><a href="#cleanup_dead_servers"><code>cleanup_dead_servers</code></a> - <strong>(Optional)</strong> Whether to remove failing servers when a\nreplacement comes online. Defaults to true.</p>\n</li>',elementType:"li",listDepth:1},{name:"last_contact_threshold",description:'<li><p><a name="last_contact_threshold"></a><a href="#last_contact_threshold"><code>last_contact_threshold</code></a> - <strong>(Optional)</strong> The time after which a server is\nconsidered as unhealthy and will be removed. Defaults to <code>"200ms"</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"max_trailing_logs",description:'<li><p><a name="max_trailing_logs"></a><a href="#max_trailing_logs"><code>max_trailing_logs</code></a> - <strong>(Optional)</strong> The maximum number of Raft log entries a\nserver can trail the leader. Defaults to 250.</p>\n</li>',elementType:"li",listDepth:1},{name:"server_stabilization_time",description:'<li><p><a name="server_stabilization_time"></a><a href="#server_stabilization_time"><code>server_stabilization_time</code></a> - <strong>(Optional)</strong> The period to wait for a server to be\nhealthy and stable before being promoted to a full, voting member. Defaults to\n<code>"10s"</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"redundancy_zone_tag",description:'<li><p><a name="redundancy_zone_tag"></a><a href="#redundancy_zone_tag"><code>redundancy_zone_tag</code></a> - <strong>(Optional)</strong> The <a href="https://www.consul.io/docs/guides/autopilot.html#redundancy-zones">redundancy zone</a>\ntag to use. Consul will try to keep one voting server by zone to take advantage\nof isolated failure domains. Defaults to an empty string.</p>\n</li>',elementType:"li",listDepth:1},{name:"disable_upgrade_migration",description:'<li><p><a name="disable_upgrade_migration"></a><a href="#disable_upgrade_migration"><code>disable_upgrade_migration</code></a> - <strong>(Optional)</strong> Whether to disable <a href="https://www.consul.io/docs/guides/autopilot.html#redundancy-zones">upgrade migrations</a>.\nDefaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"upgrade_version_tag",description:'<li><p><a name="upgrade_version_tag"></a><a href="#upgrade_version_tag"><code>upgrade_version_tag</code></a> - <strong>(Optional)</strong> The tag to override the version information\nused during a migration. Defaults to an empty string.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/autopilot_config.html",docType:""},{id:9,type:"  consul_catalog_entry",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Required)</strong> The address of the node being added to,\nor referenced in the catalog.</p>\n</li>',elementType:"li",listDepth:1},{name:"node",description:'<li><p><a name="node"></a><a href="#node"><code>node</code></a> - <strong>(Required)</strong> The name of the node being added to, or\nreferenced in the catalog.</p>\n</li>',elementType:"li",listDepth:1},{name:"service",description:'<li><p><a name="service"></a><a href="#service"><code>service</code></a> - <strong>(Optional)</strong> A service to optionally associated with\nthe node. Supported values are documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"token",description:'<li><p><a name="token"></a><a href="#token"><code>token</code></a> - <strong>(Optional)</strong> ACL token.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>service</code> block supports the following:</p>",elementType:"p"},{name:"address",description:"<strong>(Optional)</strong> The address of the service. Defaults to the\nnode address.\n",elementType:"li",listDepth:1},{name:"id",description:"<strong>(Optional)</strong> The ID of the service. Defaults to the <code>name</code>.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> The name of the service\n",elementType:"li",listDepth:1},{name:"port",description:"<strong>(Optional)</strong> The port of the service.\n",elementType:"li",listDepth:1},{name:"tags",description:"<strong>(Optional)</strong> A list of values that are opaque to Consul,\nbut can be used to distinguish between services or nodes.\n",elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/catalog_entry.html",docType:""},{id:10,type:"  consul_config_entry",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"kind",description:'<li><p><a name="kind"></a><a href="#kind"><code>kind</code></a> - <strong>(Required)</strong> The kind of configuration entry to register.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the configuration entry being registred.</p>\n</li>',elementType:"li",listDepth:1},{name:"config_json",description:'<li><p><a name="config_json"></a><a href="#config_json"><code>config_json</code></a> - <strong>(Optional)</strong> An arbitrary map of configuration values.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/config_entry.html",docType:""},{id:11,type:"  consul_intention",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"source_name",description:'<li><p><a name="source_name"></a><a href="#source_name"><code>source_name</code></a> - (Required, string) The name of the source service for the intention. This\nservice does not have to exist.</p>\n</li>',elementType:"li",listDepth:1},{name:"destination_name",description:'<li><p><a name="destination_name"></a><a href="#destination_name"><code>destination_name</code></a> - (Required, string) The name of the destination service for the intention. This\nservice does not have to exist.</p>\n</li>',elementType:"li",listDepth:1},{name:"action",description:'<li><p><a name="action"></a><a href="#action"><code>action</code></a> - (Required, string) The intention action. Must be one of <code>allow</code> or <code>deny</code>.</p>\n</li>',elementType:"li",listDepth:1},{name:"meta",description:'<li><p><a name="meta"></a><a href="#meta"><code>meta</code></a> - (Optional, map) Key/value pairs that are opaque to Consul and are associated\nwith the intention.</p>\n</li>',elementType:"li",listDepth:1},{name:"description",description:'<li><p><a name="description"></a><a href="#description"><code>description</code></a> - (Optional, string) Optional description that can be used by Consul\ntooling, but is not used internally.</p>\n</li>',elementType:"li",listDepth:1},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/intention.html",docType:""},{id:12,type:"  consul_keys",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"token",description:'<li><p><a name="token"></a><a href="#token"><code>token</code></a> - <strong>(Optional)</strong> The ACL token to use. This overrides the\ntoken that the agent provides by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"key",description:'<li><p><a name="key"></a><a href="#key"><code>key</code></a> - <strong>(Required)</strong> Specifies a key in Consul to be written.\nSupported values documented below.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>key</code> block supports the following:</p>",elementType:"p"},{name:"path",description:'<li><p><a name="path"></a><a href="#path"><code>path</code></a> - <strong>(Required)</strong> This is the path in Consul that should be written to.</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> The value to write to the given path.</p>\n</li>',elementType:"li",listDepth:1},{name:"flags",description:'<li><p><a name="flags"></a><a href="#flags"><code>flags</code></a> - <strong>(Optional)</strong> An <a href="https://www.consul.io/api/kv.html#flags-1">unsigned integer value</a>\nto attach to the key (defaults to 0).</p>\n</li>',elementType:"li",listDepth:1},{name:"delete",description:'<li><p><a name="delete"></a><a href="#delete"><code>delete</code></a> - <strong>(Optional)</strong> If true, then the key will be deleted when\neither its configuration block is removed from the configuration or\nthe entire resource is destroyed. Otherwise, it will be left in Consul.\nDefaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"deprecated-key-arguments",description:'<h3 id="deprecated-key-arguments">\n<a class="anchor" href="#deprecated-key-arguments" name="deprecated-key-arguments">\xbb</a>\n  Deprecated <code>key</code> arguments\n</h3>',elementType:"h3"},{name:"",description:"<p>Prior to Terraform 0.7, this resource was used both to read <em>and</em> write the\nConsul key/value store. The read functionality has moved to the <code>consul_keys</code>\n<em>data source</em>, whose documentation can be found via the navigation.</p>",elementType:"p"},{name:"",description:"<p>The pre-0.7 interface for reading keys is still supported for backward compatibility,\nbut will be removed in a future version of Terraform.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/keys.html",docType:""},{id:13,type:"  consul_key_prefix",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"token",description:'<li><p><a name="token"></a><a href="#token"><code>token</code></a> - <strong>(Optional)</strong> The ACL token to use. This overrides the\ntoken that the agent provides by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"path_prefix",description:'<li><p><a name="path_prefix"></a><a href="#path_prefix"><code>path_prefix</code></a> - <strong>(Required)</strong> Specifies the common prefix shared by all keys\nthat will be managed by this resource instance. In most cases this will\nend with a slash, to manage a "folder" of keys.</p>\n</li>',elementType:"li",listDepth:1},{name:"subkeys",description:'<li><p><a name="subkeys"></a><a href="#subkeys"><code>subkeys</code></a> - <strong>(Optional)</strong> A mapping from subkey name (which will be appended\nto the given <code>path_prefix</code>) to the value that should be stored at that key.\nUse slashes, as shown in the above example, to create "sub-folders" under\nthe given path prefix.</p>\n</li>',elementType:"li",listDepth:1},{name:"subkey",description:'<li><p><a name="subkey"></a><a href="#subkey"><code>subkey</code></a> - <strong>(Optional)</strong> A subkey to add. Supported values documented below.\nMultiple blocks supported.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The <code>subkey</code> block supports the following:</p>",elementType:"p"},{name:"path",description:'<li><p><a name="path"></a><a href="#path"><code>path</code></a> - <strong>(Required)</strong> This is the path (which will be appended to the given\n<code>path_prefix</code>) in Consul that should be written to.</p>\n</li>',elementType:"li",listDepth:1},{name:"value",description:'<li><p><a name="value"></a><a href="#value"><code>value</code></a> - <strong>(Required)</strong> The value to write to the given path.</p>\n</li>',elementType:"li",listDepth:1},{name:"flags",description:'<li><p><a name="flags"></a><a href="#flags"><code>flags</code></a> - <strong>(Optional)</strong> An <a href="https://www.consul.io/api/kv.html#flags-1">unsigned integer value</a>\nto attach to the key (defaults to 0).</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/key_prefix.html",docType:""},{id:14,type:"  consul_node",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - <strong>(Required)</strong> The address of the node being added to,\nor referenced in the catalog.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the node being added to, or\nreferenced in the catalog.</p>\n</li>',elementType:"li",listDepth:1},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the agent\'s\ndefault datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"meta",description:'<li><p><a name="meta"></a><a href="#meta"><code>meta</code></a> - (Optional, map) Key/value pairs that are associated with the node.</p>\n</li>',elementType:"li",listDepth:1}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/node.html",docType:""},{id:15,type:"  consul_prepared_query",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"token",description:'<li><p><a name="token"></a><a href="#token"><code>token</code></a> - <strong>(Optional)</strong> The ACL token to use when saving the prepared query.\nThis overrides the token that the agent provides by default.</p>\n</li>',elementType:"li",listDepth:1},{name:"stored_token",description:'<li><p><a name="stored_token"></a><a href="#stored_token"><code>stored_token</code></a> - <strong>(Optional)</strong> The ACL token to store with the prepared\nquery. This token will be used by default whenever the query is executed.</p>\n</li>',elementType:"li",listDepth:1},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - <strong>(Required)</strong> The name of the prepared query. Used to identify\nthe prepared query during requests. Can be specified as an empty string\nto configure the query as a catch-all.</p>\n</li>',elementType:"li",listDepth:1},{name:"service",description:'<li><p><a name="service"></a><a href="#service"><code>service</code></a> - <strong>(Required)</strong> The name of the service to query.</p>\n</li>',elementType:"li",listDepth:1},{name:"session",description:'<li><p><a name="session"></a><a href="#session"><code>session</code></a> - <strong>(Optional)</strong> The name of the Consul session to tie this query\'s\nlifetime to.  This is an advanced parameter that should not be used without a\ncomplete understanding of Consul sessions and the implications of their use\n(it is recommended to leave this blank in nearly all cases).  If this\nparameter is omitted the query will not expire.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - <strong>(Optional)</strong> The list of required and/or disallowed tags.  If a tag is\nin this list it must be present.  If the tag is preceded with a "!" then it is\ndisallowed.</p>\n</li>',elementType:"li",listDepth:1},{name:"only_passing",description:'<li><p><a name="only_passing"></a><a href="#only_passing"><code>only_passing</code></a> - <strong>(Optional)</strong> When <code>true</code>, the prepared query will only\nreturn nodes with passing health checks in the result.</p>\n</li>',elementType:"li",listDepth:1},{name:"connect",description:'<li><p><a name="connect"></a><a href="#connect"><code>connect</code></a> - <strong>(Optional)</strong> When <code>true</code> the prepared query will return connect\nproxy services for a queried service.  Conditions such as <code>tags</code> in the\nprepared query will be matched against the proxy service. Defaults to false.</p>\n</li>',elementType:"li",listDepth:1},{name:"near",description:'<li><p><a name="near"></a><a href="#near"><code>near</code></a> - <strong>(Optional)</strong> Allows specifying the name of a node to sort results\nnear using Consul\'s distance sorting and network coordinates. The magic\n<code>_agent</code> value can be used to always sort nearest the node servicing the\nrequest.</p>\n</li>',elementType:"li",listDepth:1},{name:"list description",description:'<p><a name="failover"></a><a href="#failover"><code>failover</code></a> - (Optional) Options for controlling behavior when no healthy\nnodes are available in the local DC.</p>',elementType:"p"},{name:"nearest_n",description:"<strong>(Optional)</strong> Return results from this many datacenters,\nsorted in ascending order of estimated RTT.\n",elementType:"li",listDepth:2},{name:"datacenters",description:"<strong>(Optional)</strong> Remote datacenters to return results from.\n",elementType:"li",listDepth:2},{name:"list description",description:'<p><a name="dns"></a><a href="#dns"><code>dns</code></a> - (Optional) Settings for controlling the DNS response details.</p>',elementType:"p"},{name:"ttl",description:"<strong>(Optional)</strong> The TTL to send when returning DNS results.\n",elementType:"li",listDepth:2},{name:"list description",description:'<p><a name="template"></a><a href="#template"><code>template</code></a> - (Optional) Query templating options. This is used to make a\nsingle prepared query respond to many different requests.</p>',elementType:"p"},{name:"type",description:"<strong>(Required)</strong> The type of template matching to perform. Currently\nonly <code>name_prefix_match</code> is supported.\n",elementType:"li",listDepth:2},{name:"regexp",description:"<strong>(Required)</strong> The regular expression to match with. When using\n<code>name_prefix_match</code>, this regex is applied against the query name.\n",elementType:"li",listDepth:2}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/prepared_query.html",docType:""},{id:16,type:"  consul_service",properties:[{name:"",description:"<p>The following arguments are supported:</p>",elementType:"p"},{name:"name",description:'<li><p><a name="name"></a><a href="#name"><code>name</code></a> - (Required, string) The name of the service.</p>\n</li>',elementType:"li",listDepth:1},{name:"node",description:'<li><p><a name="node"></a><a href="#node"><code>node</code></a> - (Required, string) The name of the node the to register the service on.</p>\n</li>',elementType:"li",listDepth:1},{name:"address",description:'<li><p><a name="address"></a><a href="#address"><code>address</code></a> - (Optional, string) The address of the service. Defaults to the\naddress of the node.</p>\n</li>',elementType:"li",listDepth:1},{name:"service_id",description:'<li><p><a name="service_id"></a><a href="#service_id"><code>service_id</code></a> (Optional, string) - If the service ID is not provided, it will be defaulted to the value\nof the <code>name</code> attribute.</p>\n</li>',elementType:"li",listDepth:1},{name:"port",description:'<li><p><a name="port"></a><a href="#port"><code>port</code></a> - (Optional, int) The port of the service.</p>\n</li>',elementType:"li",listDepth:1},{name:"checks",description:'<li><p><a name="checks"></a><a href="#checks"><code>checks</code></a> - (Optional, list of checks) Health-checks to register to monitor the\nservice. The list of attributes for each health-check is detailled below.</p>\n</li>',elementType:"li",listDepth:1},{name:"tags",description:'<li><p><a name="tags"></a><a href="#tags"><code>tags</code></a> - (Optional, set of strings) A list of values that are opaque to Consul,\nbut can be used to distinguish between services or nodes.</p>\n</li>',elementType:"li",listDepth:1},{name:"datacenter",description:'<li><p><a name="datacenter"></a><a href="#datacenter"><code>datacenter</code></a> - <strong>(Optional)</strong> The datacenter to use. This overrides the\nagent\'s default datacenter and the datacenter in the provider setup.</p>\n</li>',elementType:"li",listDepth:1},{name:"meta",description:'<li><p><a name="meta"></a><a href="#meta"><code>meta</code></a> - <strong>(Optional)</strong> A map of arbitrary KV metadata linked to the service\ninstance.</p>\n</li>',elementType:"li",listDepth:1},{name:"",description:"<p>The following attributes are available for each health-check:</p>",elementType:"p"},{name:"check_id",description:"(Optional, string) An ID, <em>unique per agent</em>. Will default to <em>name</em>\nif not set.\n",elementType:"li",listDepth:1},{name:"name",description:"<strong>(Required)</strong> The name of the health-check.\n",elementType:"li",listDepth:1},{name:"notes",description:"(Optional, string) An opaque field meant to hold human readable text.\n",elementType:"li",listDepth:1},{name:"status",description:"(Optional, string) The initial health-check status.\n",elementType:"li",listDepth:1},{name:"tcp",description:"(Optional, string) The TCP address and port to connect to for a TCP check.\n",elementType:"li",listDepth:1},{name:"http",description:"(Optional, string) The HTTP endpoint to call for an HTTP check.\n",elementType:"li",listDepth:1},{name:"header",description:"(Optional, set of headers) The headers to send for an HTTP check.\nThe attributes of each header is given below.\n",elementType:"li",listDepth:1},{name:"tls_skip_verify",description:"(Optional, boolean) Whether to deactivate certificate\nverification for HTTP health-checks. Defaults to <code>false</code>.\n",elementType:"li",listDepth:1},{name:"method",description:"(Optional, string) The method to use for HTTP health-checks. Defaults\nto <code>GET</code>.\n",elementType:"li",listDepth:1},{name:"interval",description:"(Required, string) The interval to wait between each health-check\ninvocation.\n",elementType:"li",listDepth:1},{name:"timeout",description:"(Required, string) The timeout value for HTTP checks.\n",elementType:"li",listDepth:1},{name:"deregister_critical_service_after",description:"(Optional, string) The time after which\nthe service is automatically deregistered when in the <code>critical</code> state.\nDefaults to <code>30s</code>.\n",elementType:"li",listDepth:1},{name:"",description:"<p>Each <code>header</code> must have the following attributes:\n* <code>name</code> - (Required, string) The name of the header.\n* <code>value</code> - (Required, list of strings) The header's list of values.</p>",elementType:"p"}],docsUrl:"https://www.terraform.io/docs/providers/consul/r/service.html",docType:""}]}}]);